import styled from 'styled-components';
function Homepage() {
  return (
   <StyledWrapper>
    <div id='a'>
      <div id='inside'>x</div>
      <div id='inside'>y</div>
      <div id='inside'>z</div>
    </div>
    <div id='b'>b</div>
    <div id='c'>c</div>
    <div id='d'>d</div>
    <div id='e'>e</div>
    <div id='f'>f</div>
    <div id='g'>g</div>
    <div id='h'>h</div>

    </StyledWrapper>
  );
}

const StyledWrapper = styled.div`
 height:100vh;
 display:grid;
 grid-template-columns: repeat(6) ;
 grid-template-rows: repeat(5, 150px) ;
 grid-gap: 20px 20px;
 padding-top:20px;

 background: var(--mainbg);
 background-size: var(--mainbg-size);

 div{
  background-color: #1d1d1d;
  color: #FE4A49;
  display:flex;
    justify-content:center;
    align-items: center;
    font-size:40px;
 }
  #a,#b{
    grid-column-start:1;
    grid-column-end: 7;
  }
  #a{
    display:grid
    grid-template-columns: 1fr 4fr 1fr;
    grid-gap:20px;
  }
  #inside{
    border: solid #FE4A49;
  }

`;

export default Homepage;
